import React from "react";
import "./headsect.css";
import logo from "../../Images/logo.png";
import { Link } from "react-router-dom";

const headsect = () => {
  return (
    <>
      <div className="outee">
        <nav>
          <img className="img-nav" src={logo} alt="" width="50" height="50" />
        </nav>
        <header class="header">
          <div class="left-content">
            <p class="stay-home">Stay Home!!</p>
            <h1>Be a good Easter egg.</h1>
            <p></p>
            <p class="para">
              That's what we need right now. Lorem ipsum dolor sit amet
              consectetur, adipisicing elit. Aliquam, corporis.
            </p>
            <button>Save Lifes</button>
          </div>
        </header>
      </div>
    </>
  );
};

export default headsect;
